(402, 101, 'tcp', 443, 'http', 'nginx', '1.22.1', 'http-slowloris-check', '   VULNERABLE:   Slowloris DOS attack     State: LIKELY VULNERABLE     IDs:  CVE:CVE-2007-6750       Slowloris tries to keep many connections to the target web server open and hold       them open as long as possible.  It accomplishes this by opening connections to       the target web server and sending a partial request. By doing so, it starves       the http server\'s resources causing Denial Of Service.            Disclosure date: 2009-09-17     References:       https://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2007-6750       http://ha.ckers.org/slowloris/ '),
