(481, 123, 'tcp', 25, 'smtp', 'Postfix smtpd', '', 'ssl-dh-params', '   VULNERABLE:   Anonymous Diffie-Hellman Key Exchange MitM Vulnerability     State: VULNERABLE       Transport Layer Security (TLS) services that use anonymous       Diffie-Hellman key exchange only provide protection against passive       eavesdropping, and are vulnerable to active man-in-the-middle attacks       which could completely compromise the confidentiality and integrity       of any data exchanged over the resulting session.     Check results:       ANONYMOUS DH GROUP 1             Cipher Suite: TLS_DH_anon_WITH_AES_128_CBC_SHA             Modulus Type: Safe prime             Modulus Source: RFC2409/Oakley Group 2             Modulus Length: 1024             Generator Length: 8             Public Key Length: 1024     References:       https://www.ietf.org/rfc/rfc2246.txt '),
