(511, 129, 'tcp', 25, 'smtp', 'Postfix smtpd', '', 'ssl-poodle', '   VULNERABLE:   SSL POODLE information leak     State: VULNERABLE     IDs:  CVE:CVE-2014-3566  BID:70574           The SSL protocol 3.0, as used in OpenSSL through 1.0.1i and other           products, uses nondeterministic CBC padding, which makes it easier           for man-in-the-middle attackers to obtain cleartext data via a           padding-oracle attack, aka the \"POODLE\" issue.     Disclosure date: 2014-10-14     Check results:       TLS_RSA_WITH_AES_128_CBC_SHA     References:       https://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2014-3566       https://www.openssl.org/~bodo/ssl-poodle.pdf       https://www.securityfocus.com/bid/70574       https://www.imperialviolet.org/2014/10/14/poodle.html '),
(512, 129, 'tcp', 25, 'smtp', 'Postfix smtpd', '', 'ssl-dh-params', '   VULNERABLE:   Anonymous Diffie-Hellman Key Exchange MitM Vulnerability     State: VULNERABLE       Transport Layer Security (TLS) services that use anonymous       Diffie-Hellman key exchange only provide protection against passive       eavesdropping, and are vulnerable to active man-in-the-middle attacks       which could completely compromise the confidentiality and integrity       of any data exchanged over the resulting session.     Check results:       ANONYMOUS DH GROUP 1             Cipher Suite: TLS_DH_anon_WITH_RC4_128_MD5             Modulus Type: Safe prime             Modulus Source: postfix builtin             Modulus Length: 1024             Generator Length: 8             Public Key Length: 1024     References:       https://www.ietf.org/rfc/rfc2246.txt      Diffie-Hellman Key Exchange Insufficient Group Strength     State: VULNERABLE       Transport Layer Security (TLS) services that use Diffie-Hellman groups       of insufficient strength, especially those using one of a few commonly       shared groups, may be susceptible to passive eavesdropping attacks.     Check results:       WEAK DH GROUP 1             Cipher Suite: TLS_DHE_RSA_WITH_DES_CBC_SHA             Modulus Type: Safe prime             Modulus Source: postfix builtin             Modulus Length: 1024             Generator Length: 8             Public Key Length: 1024     References:       https://weakdh.org '),
